import React, {useState} from 'react';
import axios from 'axios';
import './css/ServerThumbnail.css';

function ServerThumbnail(props) {
    return(
        <div className="server-thumbnail-wrapper w-90 m-2 border border-secondary row">
            <div className="server-thumbnail-icon col my-auto">
                <img className="server-thumbnail-image" src={`${process.env.SERVER_URL}servers/${props.id}`}/>
            </div>
            <div className="server-thumbnail-name col my-auto">
                Server Name
            </div>
        </div>

    );
}

export default ServerThumbnail;
